import React from 'react'
import { categories } from './../data/data.js';

const Category = () => {
    console.log(categories);
  return (
    <div>
        <h1>Top Rated Menu Items</h1>
        {/* category */}
        <div>
            {categories.map((items, index)=>(
                <div key={items}>
                    <h2>{items.name}</h2>
                    <img src={items.image} alt={items.name}/>
                </div>
            ))}
        </div>
    </div>
  )
}

export default Category
